(3, NULL, NULL, 'elektronik-ve-nesnelerin-interneti-iot', 'Elektronik ve Nesnelerin İnterneti (IOT)', NULL, 'nesnelerin_interneti.jpg', 'nesnelerin_interneti.jpg', 'Elektronik ve Nesnelerin İnterneti IOT', 'Elektronik ve Nesnelerin İnterneti IOT', 1, 0, '2022-09-21 21:00:00', '2022-09-21 21:00:00', NULL, 'Geniş üretici ağımız ve yapay zeka destekli üretim dağıtım platformumuzla Nesnelerin interneti sektöründeki donanım geliştirme şirketlerinin üretim süreçlerine hız ve verimlilik getiriyoruz.', '<h2 id=\"isPasted\" style=\"box-sizing: border-box; margin-top: 0.3rem; margin-bottom: 20px; font-weight: 400; line-height: 1.2; font-size: 30px; font-family: Rubik, Helvetica, Arial, sans-serif; color: rgb(35, 56, 68); overflow-wrap: break-word; display: block; padding-top: 25px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Nesnelerin İnterneti(IOT) Nedir ?</h2><p><br></p><p><span id=\"isPasted\" style=\'color: rgb(93, 95, 100); font-family: \"Source Sans Pro\", Arial, Helvetica, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\'>Kısaltması IoT olan &ldquo;Internet of Things&rdquo; teriminin T&uuml;rk&ccedil;edeki karşılığı olarak sunulan nesnelerin interneti, g&uuml;nl&uuml;k hayatta kullanılan nesnelerin internet sayesinde diğer nesneler ile veri alışverişi yapabilmesini ve nesnelerin birbiriyle tam olarak senkronizasyon halinde olmalarını sağlayan bir teknolojidir.&nbsp;</span>&nbsp;</p><p><br></p><p><strong id=\"isPasted\" style=\'box-sizing: border-box; font-weight: bolder; color: rgb(93, 95, 100); font-family: \"Source Sans Pro\", Arial, Helvetica, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>Nesne Bileşeni:&nbsp;</strong><span style=\'color: rgb(93, 95, 100); font-family: \"Source Sans Pro\", Arial, Helvetica, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\'>Nesne bileşeni karar verilebilmesi i&ccedil;in internete ve birbirine bağlı olan cihazları ifade eden kavramdır. Bu nesneler, dahili bir sunucu ve harici &ccedil;evre arasında iletişimin kurulmasını sağlayan g&ouml;m&uuml;l&uuml; sistemler kullanırlar.</span></p><p><br></p><h2 id=\"isPasted\" style=\"box-sizing: border-box; margin-top: 0.3rem; margin-bottom: 20px; font-weight: 400; line-height: 1.2; font-size: 30px; font-family: Rubik, Helvetica, Arial, sans-serif; color: rgb(35, 56, 68); overflow-wrap: break-word; display: block; padding-top: 25px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Nesnelerin İnterneti (IOT) Sistemlerinin Bileşenleri Nelerdir?</h2><p style=\"box-sizing: border-box; margin: 0px 0px 20px; line-height: 1.5; font-size: 1rem; font-weight: 300; color: rgb(86, 86, 86); overflow-wrap: break-word; display: block; font-family: Rubik, Helvetica, Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Nesnelerin interneti bileşenleri, bu t&uuml;r yapıların kurulması i&ccedil;in gerekli olan unsurları ifade eder. IoT sistemlerinin <em style=\"box-sizing: border-box; color: rgb(86, 86, 86); font-weight: 300;\">beş temel bileşeni&nbsp;</em>şunlardır:</p><ul style=\"list-style-type: circle;\"><li class=\"fr-text-spaced\"><strong style=\"box-sizing: border-box; font-weight: 500;\">Akıllı Cihazlar ve Sens&ouml;rler:</strong> Sistem i&ccedil;indeki veri alışverişi, cihazlarda bulunan sens&ouml;rler sayesinde ger&ccedil;ekleştirilir. Bu par&ccedil;alar, &ccedil;evredeki verilerin toplanmasını ya da algılanmasını sağlar.</li></ul><p><br></p><ul style=\"list-style-type: circle;\"><li class=\"fr-text-spaced\"><strong style=\"box-sizing: border-box; font-weight: 500;\">Getaway (Ağ Ge&ccedil;idi):&nbsp;</strong>S&ouml;z konusu verilerin diğer cihazlara ulaşabilmesi i&ccedil;in arada kurulmuş bir ağ olması gerekir. Ağ ge&ccedil;itleri bu iletişimi m&uuml;mk&uuml;n kılar, ağ uygunluklarını d&uuml;zenler ve şifreleme y&ouml;ntemleri ile işlem i&ccedil;in gerekli g&uuml;venlik ortamını oluşturur.</li></ul><p><br></p><ul style=\"list-style-type: circle;\"><li class=\"fr-text-spaced\"><strong style=\"box-sizing: border-box; font-weight: 500;\">Cloud (Bulut Teknolojisi):</strong> Sistem i&ccedil;inde alışverişi yapılan verilerin boyutları, bir noktadan sonra fazlasıyla b&uuml;y&uuml;yebilir. Bu gibi durumlarda bulut teknolojisi devreye girer ve verilerin kullanılmasını olanaklı h&acirc;le getirir. Veriler, ger&ccedil;ek zamanlı olarak buluta y&uuml;klenirken diğer cihazlar tarafından da aynı şekilde buluttan &ccedil;ekilir. Bir t&uuml;r iletişim merkezi gibi iş g&ouml;re bulut teknolojisinin nesnelerin interneti i&ccedil;in taşıdığı &ouml;nem b&uuml;y&uuml;kt&uuml;r. Zira bu sayede veri transferi daha g&uuml;venilir ve hızlı hale gelir.</li></ul><p><br></p><ul style=\"list-style-type: circle;\"><li class=\"fr-text-spaced\"><strong style=\"box-sizing: border-box; font-weight: 500;\">Analiz:&nbsp;</strong>Bu bileşen, sistemin tamamının ya da tek bir cihazın olası sorunları &ouml;nceden belirleyebilmesini sağlar. B&ouml;ylelikle gerekli &ouml;nlemler daha pratik şekilde alınabilir. Hatalar ile bunlara bağlı arıza ve masraflar minimum d&uuml;zeye indirilir.</li></ul><p><br></p><ul style=\"list-style-type: circle;\"><li class=\"fr-text-spaced\"><strong style=\"box-sizing: border-box; font-weight: 500;\">Gelişmiş Kullanıcı Aray&uuml;z&uuml;:</strong> Cihazların kolay kullanılabilen aray&uuml;zlere sahip olması, nesnelerin internetinin yaygınlaşmasına yardımcı olan fakt&ouml;rlerden biridir. Zira basit ve dokunmatik aray&uuml;zler &uuml;zerinden kontrol edilen cihazlar sayesinde en &ouml;nemli işlemler, en az eforla kısa s&uuml;rede yapılabilir. Bu da pek &ccedil;ok konuda tasarruf etmek anlamına gelir.</li></ul><p><br></p><h2 id=\"isPasted\" style=\"box-sizing: border-box; margin-top: 0.3rem; margin-bottom: 20px; font-weight: 400; line-height: 1.2; font-size: 30px; font-family: Rubik, Helvetica, Arial, sans-serif; color: rgb(35, 56, 68); overflow-wrap: break-word; display: block; padding-top: 25px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">End&uuml;striyel IOT Nedir?</h2><p style=\'box-sizing: border-box; margin: 0px 0px 1.1em; padding: 0px; list-style: none; background-repeat: no-repeat; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; line-height: 1.4; color: rgb(22, 21, 19); font-family: OracleSansVF, OracleSansVFCyGr, -apple-system, BlinkMacSystemFont, \"Segoe UI\", \"Helvetica Neue\", sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'>End&uuml;striyel IoT (IIoT), &ouml;zellikle bulut teknolojilerini kullanan sens&ouml;r ve cihazların enstr&uuml;mantasyonu ve kontrol&uuml; bakımından, IoT teknolojisinin end&uuml;striyel ortamlarda uygulanmasını ifade eder. Son zamanlarda, end&uuml;striler kablosuz otomasyon ve kontrol elde etmek i&ccedil;in makineler arası iletişimi (M2M) kullanmıştır. Ancak bulut teknolojisinin ve benzer teknolojilerin (analitik ve makine &ouml;ğrenimi gibi) ortaya &ccedil;ıkmasıyla birlikte end&uuml;striler yeni bir otomasyon katmanı elde edebilir ve yeni gelir ve iş modelleri oluşturabilir. IIoT bazen sanayi devriminin d&ouml;rd&uuml;nc&uuml; dalgası veya End&uuml;stri 4.0 olarak adlandırılır. IIoT i&ccedil;in bazı yaygın kullanımlar şunlardır:</p><ul style=\'box-sizing: border-box; margin: 0px 0px 1.1em; padding: 0px 1em 0px 0px; list-style: circle; background-repeat: no-repeat; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; overflow: hidden; color: rgb(22, 21, 19); font-family: OracleSansVF, OracleSansVFCyGr, -apple-system, BlinkMacSystemFont, \"Segoe UI\", \"Helvetica Neue\", sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"box-sizing: border-box; margin: 0px 1.25em 0.6em 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Akıllı &uuml;retim</li><li style=\"box-sizing: border-box; margin: 0px 1.25em 0.6em 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Bağlantılı varlıklar ve &ouml;nleyici ve &ouml;ng&ouml;r&uuml;ye dayalı bakım</li><li style=\"box-sizing: border-box; margin: 0px 1.25em 0.6em 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Akıllı g&uuml;&ccedil; elektronik tabloları</li><li style=\"box-sizing: border-box; margin: 0px 1.25em 0.6em 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Akıllı şehirler</li><li style=\"box-sizing: border-box; margin: 0px 1.25em 0.6em 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Bağlantılı lojistik</li><li style=\"box-sizing: border-box; margin: 0px 1.25em 0px 0px; padding: 0px; list-style: none; background: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); -webkit-font-smoothing: antialiased; position: relative; left: 1.25em; display: list-item !important;\">Akıllı dijital tedarik zincirleri</li></ul><p><br></p><p><br></p>');
